import React, { useState } from 'react';
import './App.css';

function App() {
  const [email, setEmail] = useState('');
  const [status, setStatus] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setStatus('');

    try {
      const response = await fetch('http://127.0.0.1:5000/api/subscribe', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email }),
      });
      const result = await response.json();
      setStatus(result.message);
    } catch (error) {
      console.error(error);
      setStatus('Error subscribing. Please try again.');
    }
  };

  // Sample data for the 3Ã—3 grid
  const featuresData = [
    {
      tag: 'Growth',
      title: 'Dynamic Conditional Logic',
      desc: 'Get high-quality design work at a fraction of the cost.',
      img: '/assets/inage11.png'
    },
    {
      tag: 'Growth',
      title: 'Real time Ai Summaries',
      desc: 'We have the expertise to make your vision a reality.',
      img: '/assets/image22.png'
    },
    {
      tag: '',
      title: 'Security',
      desc: "We're ready to meet your evolving needs.",
      img: '/assets/image33.png'
    },
    {
      tag: 'Growth',
      title: 'Analytics & Reporting',
      desc: 'Get high-quality design work at a fraction of the cost.',
    },
    {
      tag: '',
      title: 'Seamless Integration',
      desc: 'We have the expertise to make your vision a reality.',
    },
    {
      tag: '',
      title: 'Payment Processing',
      desc: "We're ready to meet your evolving needs.",
    },
    {
      tag: '',
      title: 'Customizable Intake Forms',
      desc: 'Get high-quality design work at a fraction of the cost.',
    },
    {
      tag: '',
      title: 'Voice Input Support',
      desc: 'We have the expertise to make your vision a reality.',
    },
    {
      tag: '',
      title: '?????????',
      desc: "We're ready to meet your evolving needs.",
    },
  ];

  return (
    <div>
      {/* ------------------ Hero Section ------------------ */}
      <section className="hero-container">
        <video autoPlay loop muted className="background-video">
          <source src="/background.mp4" type="video/mp4" />
          Your browser does not support HTML5 video.
        </video>

        <div className="overlay">
          {/* Navbar */}
          <nav className="navbar">
            <div className="logo">YourLogo</div>
            <ul className="nav-links">
              <li><a href="#hero">Home</a></li>
              <li><a href="#features">Features</a></li>
              <li><a href="#testimonials">Testimonials</a></li>
              <li><a href="#faq">FAQ</a></li>
            </ul>
            <button className="notify-btn">Notify me</button>
          </nav>

          {/* Hero content near bottom */}
          <div className="hero-content" id="hero">
            <h1 className="hero-heading">
              Seamless Intake,<br />
              Instant Insights
            </h1>
            <p className="hero-subtext">
              Our company specializes in AI-powered custom dynamic intake forms that adapt to user responses
              and generate comprehensive, easy-to-read summariesâ€”streamlining decision-making
              and enhancing efficiency.
            </p>

            {/* Subscription form */}
            <form onSubmit={handleSubmit} className="subscribe-form">
              <input
                type="email"
                name="email"
                placeholder="name@email.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
              <button type="submit" className="subscribe-button">
                Get notified
              </button>
            </form>
            {status && <p className="status-message">{status}</p>}
          </div>
        </div>
      </section>

      {/* ------------------ Features Section ------------------ */}
      <section className="features-page" id="features">
        <h2 className="features-title">Our Features</h2>
        <div className="features-grid">
          {featuresData.map((item, idx) => (
            <div className="feature-card" key={idx}>
              {/* Move the image above the text */}
              {item.img && (
                <img 
                  src={item.img} 
                  alt={item.title} 
                  className="feature-image" 
                />
              )}

              {item.tag && <div className="feature-tag">{item.tag}</div>}
              <h3>{item.title}</h3>
              <p>{item.desc}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Placeholder for other sections, e.g. testimonials/FAQ */}
      <section className="placeholder" id="testimonials">
        <h2>Testimonials</h2>
        <p>Coming soon...</p>
      </section>

      <section className="placeholder" id="faq">
        <h2>FAQ</h2>
        <p>Coming soon...</p>
      </section>
    </div>
  );
}

export default App;
